import { DivNavbar } from "./styles";

const Navbar = () => (
  <div>
    <DivNavbar>
      <div className="logo">
        <h3>
          Mark <i className="fas fa-shopping-cart" />
        </h3>
      </div>
    </DivNavbar>
  </div>
);

export default Navbar;
